import { Link, useNavigate } from "react-router-dom";
import SignupTitle from "./signuptitle";
import React, { Component } from "react";

const logoStyle = {
    position: 'absolute',
    width: '397px',
    height: '131px',
    left: '122px',
    top: '83px'
}

function SignupForm() {
    let state = {
        username: '',
        email: '',
        password: '',
        identity: ''
    };
    let handleSubmit = async e => {
        e.preventDefault();
        // 后端
        const { data } = await this.props.registerFn.registerAc(this.state);

        console.log(data);
        let navigate = useNavigate();

        navigate("/", { replace: true });

        /* this.props.history.push("/"); */
    };
    let handleChange = e => {
        this.setState({
            [e.target.name]: e.target.value
        })
    };


        const { username, email, password, identity } = this.state;
        return (
            <div id="signup-page">
                <Link to="/"><img src="./LOGO-H 1.png" alt='logo' style={logoStyle}></img></Link>
                <div>
                    <form id="signup-form" onSubmit={this.handleSubmit}>
                        <SignupTitle />
                        <div>
                            <label className="user-info">
                                <input type="email" name="email" placeholder="Your email..." className="email" defaultValue={username} onChange={this.handleChange} />
                                <p></p>
                            </label>

                        </div>
                        <div>
                            <label className="user-info">
                                <input type="text" name="username" placeholder="Your username..." className="username" id="username" defaultValue={email} onChange={this.handleChange} required />
                            </label>
                        </div>
                        <div>
                            <label className="user-info">
                                <input type="password" name="password" placeholder="Your password..." className="password" defaultValue={password} onChange={this.handleChange} />
                            </label>
                        </div>
                        <div>
                            <label className="user-info">
                                <input type="password" name="confirmpassword" placeholder="Confirm password..." className="password" />
                            </label>
                        </div>
                        <div id="sign-radio">
                            <label>
                                <input type="radio" value="Normal" name="identity" class="identity" defaultValue={identity} onChange={this.handleChange} />Normal
                            </label>
                            <label>
                                <input type="radio" value="Professional" name="identity" class="identity" defaultValue={identity} onChange={this.handleChange} />Professional
                            </label>

                        </div>
                        <div id="sign-btn">
                            <input type="submit" value="Create Account" id="createAccount" />
                        </div>


                    </form>
                </div>

            </div>
        )

};

export default SignupForm;
